class VideoDetailMo {
  VideoDetailMo(
      {bool? isFavorite,
      bool? isLike,
      VideoMo? videoInfo,
      List<VideoMo>? videoList}) {
    _isFavorite = isFavorite;
    _isLike = isLike;
    _videoInfo = videoInfo;
    _videoList = videoList;
  }

  VideoDetailMo.fromJson(dynamic json) {
    _isFavorite = json['isFavorite'];
    _isLike = json['isLike'];
    _videoInfo = json['videoInfo'] != null
        ? VideoMo.fromJson(json['videoInfo'])
        : null;
    if (json['videoList'] != null) {
      _videoList = [];
      json['videoList'].forEach((v) {
        _videoList?.add(VideoMo.fromJson(v));
      });
    }
  }

  bool? _isFavorite;
  bool? _isLike;
  VideoMo? _videoInfo;
  List<VideoMo>? _videoList;

  bool? get isFavorite => _isFavorite;

  bool? get isLike => _isLike;

  VideoMo? get videoInfo => _videoInfo;

  List<VideoMo>? get videoList => _videoList;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['isFavorite'] = _isFavorite;
    map['isLike'] = _isLike;
    if (_videoInfo != null) {
      map['videoInfo'] = _videoInfo?.toJson();
    }
    if (_videoList != null) {
      map['videoList'] = _videoList?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}


